var defaultCats = {
	Unseen: unseen,
    People: people,
    // nature: nature,
    // objects: objects,
    // places: places,
    // symbols: symbols
}

var curSearchText = '';
var curSearchText_LowerCase = '';

function handler(item){
    return (':' + item.name + ':').indexOf(curSearchText_LowerCase) != -1;
}

function applyFilter(text){
    curSearchText = text;
    curSearchText_LowerCase = text.toLowerCase();

    return {
        Unseen: unseen.filter(handler),
        People: people.filter(handler),
        // nature: nature.filter(handler),
        // objects: objects.filter(handler),
        // places: places.filter(handler),
        // symbols: symbols.filter(handler)
    }
}

var instance = {
    cats: defaultCats,
    filterText: curSearchText,
    applyFilter: function(text){
        if(text == null || text == ''){
            this.cats = defaultCats;
        }
        else{
            this.cats = applyFilter(text);
        }
        
        return this.cats;
    },
    resetFilter: function(){
        curSearchText = '';
        curSearchText_LowerCase = '';
    }
};

export default instance;